import React, { Component } from 'react';


class HelloWorld extends Component {



  render() {
    const toDo = [{id:'number1',text:'im todo1'},{id:'number2',text:'todo2'},{id:'number3',text:'todododo3'}]
    const todoLis = toDo.map((toDoItem)=>{
      return (
        <li id={toDoItem.id}>{toDoItem.text}</li>
      )
    })

      return (
        <div>
          <button onClick={()=>alert('Thank you!')}>Click Me!</button>
          {todoLis}          
        </div>
      ) 

  }
}

export default HelloWorld;
